import './App.css';
import './components'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome to ANEYWEB!
        </p>
        <p> here is some tips for you</p>

        <a
          className="App-link"
          href="https://www.yenaengineering.nl"
          target="_blank"
          rel="noopener noreferrer"
        >
         yenaengineering.nl
        </a>
      </header>
    </div>
  );
}

export default App;
